import styled from 'styled-components';

const ProductsMainPageStyles = styled.div`
  margin-top: 8rem;

  h2 {
    font-size: 4rem;
    text-transform: uppercase;
    font-weight: 400;
  }
`;

export { ProductsMainPageStyles };
